import React from 'react';
import './Accessories.css';

const accessories = [
    { id: 1, name: "Accessory 1", description: "Description of Accessory 1", image: "/images/accessory1.jpg" },
    { id: 2, name: "Accessory 2", description: "Description of Accessory 2", image: "/images/accessory2.jpg" },
    // ...add more accessories
    { id: 20, name: "Accessory 20", description: "Description of Accessory 20", image: "/images/accessory20.jpg" },
    { id: 20, name: "Accessory 20", description: "Description of Accessory 20", image: "/images/accessory20.jpg" },
    { id: 20, name: "Accessory 20", description: "Description of Accessory 20", image: "/images/accessory20.jpg" },
    { id: 20, name: "Accessory 20", description: "Description of Accessory 20", image: "/images/accessory20.jpg" },
    { id: 20, name: "Accessory 20", description: "Description of Accessory 20", image: "/images/accessory20.jpg" },
    { id: 20, name: "Accessory 20", description: "Description of Accessory 20", image: "/images/accessory20.jpg" },
    { id: 20, name: "Accessory 20", description: "Description of Accessory 20", image: "/images/accessory20.jpg" },
    { id: 20, name: "Accessory 20", description: "Description of Accessory 20", image: "/images/accessory20.jpg" },
];

const Accessories = () => {
    return (
        <div className="accessories">
            <h2>Gaming Accessories</h2>
            <div className="accessories-list">
                {accessories.map(accessory => (
                    <div key={accessory.id} className="accessory-item">
                        <img src={accessory.image} alt={accessory.name} />
                        <h3>{accessory.name}</h3>
                        <p>{accessory.description}</p>
                        <button className="buy-now">Buy Now</button>
                    </div>
                ))}
            </div>
        </div>
    );
};

export default Accessories;
